const TeamSelector = (teams) => { 

    return(
        <table>
        <form>    
            <div  className="formFieldsWrapper">
                <label className="controlsLabels">Select Team</label>
                <select 
                    name="sortOrder" 
                    className="controlsElements"
                >
                    {
                        teams.teams.map((team) => {return(<option>{team.id}</option>)})
                    }
                </select>
            </div>

        </form>
        </table>

    )
}

export default TeamSelector
